import CartDetail from './CartDetail';
import PriceCalculation from './PriceCalculation';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import React, { useEffect, useState } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import PriceTag from '../BuyNow/PriceTag';

const Cart = () => {
    const [products, setProducts] = useState([]);
    const [showBox, setShowBox] = useState(1);

    useEffect(() => {
        // Call the function to fetch products
        handleGetProducts();
    }, []);

    const handleShowBox = (id) => {
        setShowBox(id);
    };

    const handleGetProducts = async () => {
        try {
            const response = await fetch(`http://localhost:3000/find-cart`, {
                method: 'GET',
                headers: {
                    Accept: 'application/json',
                    'Content-Type': 'application/json',
                },
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            const products = await response.json();
            setProducts(products);
            console.log('Products fetched successfully:', products);
        } catch (error) {
            console.error('There was a problem with the fetch request:', error);
        }
    };
    return (
        <>
            <div style={{ backgroundColor: 'whitesmoke' }}>
                <Row>
                    <Col lg={8} md={8} sm={6} xs={12} className="col">
                        <div className="content-container">
                            <div
                                id="header1"
                                className={`HeaderBox ${
                                    showBox === 1 ? 'active' : ''
                                }`}
                                onClick={() => handleShowBox(1)}
                            >
                                <LooksOneIcon id="1Icon" /> &nbsp; LOGIN OR
                                SIGNUP
                            </div>
                            {showBox === 1 && (
                                <div className="containerBox">
                                    <LoginSignup />
                                </div>
                            )}

                            <div
                                style={{ display: 'flex' }}
                                id="header2"
                                className={`HeaderBox centerBox ${
                                    showBox === 2 ? 'active' : ''
                                }`}
                                onClick={() => handleShowBox(2)}
                            >
                                <div>
                                    <LooksTwoIcon id="2Icon" />
                                    &nbsp; DELIVERY ADDRESS
                                </div>
                                <div style={{ paddingRight: '20px' }}>
                                    <AddIcon style={{ color: 'blue' }} />
                                    &nbsp; Add a new address
                                </div>
                            </div>
                            {showBox === 2 && (
                                <div className="containerBox">
                                    <DeliveryAddress />
                                </div>
                            )}

                            <div
                                id="header3"
                                className={`HeaderBox ${
                                    showBox === 3 ? 'active' : ''
                                }`}
                                onClick={() => handleShowBox(3)}
                            >
                                <span>
                                    <Looks3Icon id="3Icon" />
                                </span>
                                &nbsp; ORDER SUMMARY
                            </div>
                            {showBox === 3 && (
                                <div className="containerBox">
                                    <OrderSummary />
                                </div>
                            )}

                            <div
                                id="header4"
                                className={`HeaderBox ${
                                    showBox === 4 ? 'active' : ''
                                }`}
                                onClick={() => handleShowBox(4)}
                            >
                                <Looks4Icon id="4Icon" />
                                &nbsp; PAYMENT OPTIONS
                            </div>
                            {showBox === 4 && (
                                <div className="containerBox">
                                    <PaymentOption />
                                </div>
                            )}
                        </div>
                    </Col>
                    <Col lg={4} md={4} sm={6} xs={12}>
                        <div className="price-container">
                            <PriceTag />
                        </div>
                    </Col>
                </Row>
            </div>
        </>
    );
};

export default Cart;
